import React from 'react'
import { useAuth } from '../../../../AuthContext'

const Profile = () => {
    const { userDetails } = useAuth()
    return (
        <div>
            <h3>Profile</h3>
            {userDetails.userName}
            {userDetails.userTitle}
            {userDetails.agencyName}
            {userDetails.userName}
        </div>
    )
}

export default Profile
